import { CHANGE_STATUS_HEATUP, CHANGE_STATUS_ASSESMENT, CHANGE_STATUS_TRAINING, SET_TIMER_STARTED, SET_TIMER_PAUSED, SET_TIMER_RESUMED, SET_TIMER_STOPPED, INCR_EXERCISE_NUMBER } from './actionTypes'

export const heatupAC = (exercise) => ({
    type: CHANGE_STATUS_HEATUP,
    payload: {
        exercise
    }
})

export const startTimerAC = (seconds) => ({
    type: CHANGE_STATUS_HEATUP,
    payload: {
        seconds
    }
})

export const incrExerciseNumberAC = (i) => ({
    type: INCR_EXERCISE_NUMBER,
    payload: {
        seconds
    }
})
